import React from "react";
import Header from "../component/Header/Header";

function FormHorario() {
  return (
    <div className="FormHorario">
      <Header />
      <h1 className="tituloPagina">Cadastro Horario</h1>
      <div className="cadastroFormularioHorarios">
        <div className="section1FormHorarios">
          <div className="divComboHorario">
            <div className="conatinerFormHorarios"></div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default FormHorario;
